import React, { useState } from "react";
import { Drawer, List, ListItem, ListItemButton, ListItemIcon, ListItemText, IconButton } from "@mui/material";
import { Home, Menu, Calculate, BarChart, Chat, Psychology, Abc, Memory, Assessment, Public, School, Work, Group, Description, Science } from "@mui/icons-material";
import { NavLink } from "react-router-dom";
import logo from "../assets/AptitudeArc.jpg";
import "../styles/Sidebar.css";

const Sidebar = () => {
  const [open, setOpen] = useState(false);

  const toggleDrawer = () => {
    setOpen(!open);
  };

  const menuItems = [
    { text: "Home", icon: <Home />, path: "/" },
    { text: "Arithmetic Aptitude", icon: <Calculate />, path: "/arithmetic" },
    { text: "Data Interpretation", icon: <BarChart />, path: "/data-interpretation" },
    { text: "Verbal Ability", icon: <Chat />, path: "/verbal-ability" },
    { text: "Logical Reasoning", icon: <Psychology />, path: "/logical-reasoning" },
    { text: "Verbal Reasoning", icon: <Abc />, path: "/verbal-reasoning" },
    { text: "Nonverbal Reasoning", icon: <Memory />, path: "/nonverbal-reasoning" },
    { text: "Online Tests", icon: <Assessment />, path: "/online-tests" },
    { text: "Current Affairs", icon: <Public />, path: "/current-affairs" },
    { text: "General Knowledge", icon: <School />, path: "/general-knowledge" },
    { text: "HR Interview", icon: <Work />, path: "/hr-interview" },
    { text: "Group Discussion", icon: <Group />, path: "/group-discussion" },
    { text: "Placement Papers", icon: <Description />, path: "/placement-papers" },
    { text: "Technical Interview", icon: <Science />, path: "/technical-interview" },
  ];

  return (
    <>
      <IconButton onClick={toggleDrawer} className="menu-button">
        <Menu />
      </IconButton>
      <Drawer anchor="left" open={open} onClose={toggleDrawer}>
        <div className="sidebar">
          <div className="logo-container">
            <img src={logo} alt="AptitudeArc Logo" className="sidebar-logo" />
          </div>
          <List>
            {menuItems.map((item, index) => (
              <ListItem key={index} disablePadding>
                <ListItemButton component={NavLink} to={item.path} onClick={toggleDrawer}>
                  <ListItemIcon>{item.icon}</ListItemIcon>
                  <ListItemText primary={item.text} />
                </ListItemButton>
              </ListItem>
            ))}
          </List>
        </div>
      </Drawer>
    </>
  );
};

export default Sidebar;
